import React from 'react';
import styles from './header.module.css'

const Header = (props) => {
    return(
        <header className={styles.header}>
            <img className={styles.logo} src="/images/logo.png" alt="youtube logo"/>
            <input className={styles.input}type="search" placeholder="검색"/>
            <button className = {styles.button} type="submit">
                <img className={styles.search_logo} src="/images/loupe.png" alt="search"/>
            </button>
            <img className={styles.search_logo} src="/images/youtube8.png" alt="make"/>
            <img className={styles.search_logo} src="/images/youtube9.png" alt="app"/>
            <img className={styles.search_logo} src="/images/youtube10.png" alt="call"/>

           
        </header>
    )
};
export default Header;
